import React, { Component } from "react";

export default class TemplateDefault extends Component {

	constructor(props) {
		super(props);
	}

	render(){
		return (
			<TemplateDefault>
			  HEADER
        <hr />

				{this.props.children}

				<hr />
				FOOTER
			</TemplateDefault>
		)
	}
}
